import React from 'react';
import './LandingPage.css'; // Ensure your CSS supports these changes

function LandingPage() {
  return (
    <div className="landing-page">
      <header className="header">
        <a href="/" className="logo-link"> {/* Make the logo clickable */}
          <div className="logo">TravelMate</div>
        </a>
      </header>

      <section className="hero">
        <div className="hero-content">
          <h1>Explore the World with Us</h1>
          <p>Your adventure starts here. Book tours, reserve tickets, and explore local attractions.</p>
          <div className="cta-buttons">
            <a href="/tour-booking" className="btn-primary">Book a Tour</a>
            <a href="/room-booking" className="btn-primary">Book a Room</a> {/* Added room booking */}
            <a href="/ride-booking" className="btn-primary">Book a Ride</a> {/* Added ride booking */}
          </div> 
        </div>
      </section>
    </div>
  );
}

export default LandingPage;
